import React from 'react';
import { Link } from 'react-router-dom';
import '../App.css'; // We get styles from the main App.css

function Navbar() {
  return (
    // 'navbar-transparent' class makes it float on the background
    <nav className="navbar navbar-transparent">
      <div className="navbar-container">
        
        {/* --- LEFT SIDE --- */}
        <div className="navbar-left">
          <Link to="/" className="nav-link">
            Home
          </Link>
        </div>

        {/* --- CENTER TITLE --- */}
        <div className="navbar-center-title">
          HOME SERVICE FINDER
        </div>

        {/* --- RIGHT SIDE --- */}
        <div className="navbar-right">
          <Link to="/login" className="btn btn-outline-white">
            Login
          </Link>
          <Link to="/provider-register" className="btn btn-primary-white">
            Join as Provider
          </Link>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
